import {
    AppstoreOutlined,
    PieChartOutlined,
    DesktopOutlined,
    ContainerOutlined,
    MailOutlined,
} from '@ant-design/icons';

const menuList = [
    {
        title: 'Home',
        key: '/dashboard/home',
        icon: <AppstoreOutlined />   
    },
    {
        title: 'Mobility GI',
        key: 'Mobility-GI',
        icon: <PieChartOutlined /> ,
        children: [
            {
                title: 'Submit',
                key: '/dashboard/gi-submit',
                icon: <DesktopOutlined /> 
            },
            {
                title: 'Check',
                key: '/dashboard/gi-check',
                icon: <ContainerOutlined /> 
            }
        ]
    },
    {
        title: 'Mobility Domestic',
        key: 'Mobility-DO',
        icon: <MailOutlined/>,
        children: [
            {
                title: 'Submit',
                key: '/dashboard/do-submit',
                icon: <AppstoreOutlined /> 
            },
            {
                title: 'Check',
                key: '/dashboard/do-check',
                icon: <AppstoreOutlined /> 
            }
        ]
    }
]

export default menuList
